import { Link } from "react-router-dom";
import { NavItem } from "./NavItem";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  display: flex;
  background-color: dodgerblue;
  position: relative;
`;
const StyledLink = styled(Link)`
  text-decoration: none;
  color: white;
  padding: 5px;
  background-color: dodgerblue;
  &:hover {
    background-color: blue;
  }
  &:active {
    background-color: darkblue;
  }
`;

export function Navbar() {
  return (
    <>
      <Container>
        <StyledLink to="/">
          <img src="/images/logo/logo.png" alt="상단로고" />
        </StyledLink>
        <StyledLink to="/intro">
          <NavItem icon="ti ti-home" name="INTRO"></NavItem>
        </StyledLink>
        <StyledLink to="/menu">
          <NavItem icon="ti ti-menu" name="MENU"></NavItem>
        </StyledLink>
        <StyledLink to="/education">
          <NavItem icon="ti ti-device-tv" name="EDUCATION"></NavItem>
        </StyledLink>
        <StyledLink to="/Franchise_Inquiry">
          <NavItem icon="ti ti-building" name="FRANCHISE"></NavItem>
        </StyledLink>
        <StyledLink to="/login">
          <NavItem icon="ti ti-login" name="LOGIN"></NavItem>
        </StyledLink>
      </Container>
    </>
  );
}
